import React, { useEffect, useState } from "react";
import axios from "axios";
import { Link } from "react-router-dom";

const endpoint = "http://localhost:8000/api";
const ShowHotel = () => {
  const [hoteles, setHoteles] = useState([]);

  useEffect(() => {
    getAllHotel();
  }, []);

  const getAllHotel = async () => {
    const rpta = await axios.get(`${endpoint}/Hoteles`);
    setHoteles(rpta.data);
  };

  const deleteHotel = async (id) => {
    axios.delete(`${endpoint}/Hotel/${id}`);
    getAllHotel();
  };

  return (
    <div class="card">
      <div className="card-header">
        <h3 class="card-title">Hoteles</h3>
      </div>

      <div className="card-header col-sm-2">
        <Link
          to="/create"
          type="button"
          className="btn btn-block bg-gradient-primary btn-lg "
        >
          crear
        </Link>
      </div>
      <div class="card-body">
        <table class="table table-bordered">
          <thead>
            <tr>
              <th scope="col">#</th>
              <th scope="col">Nombre Hotel</th>
              <th scope="col">Direccion</th>
              <th scope="col">Ciudad</th>
              <th scope="col">Nit</th>
              <th scope="col">Cantidad Habitacionies</th>
              <th scope="col">tipo Habitacionies</th>
              <th scope="col">Acciones</th>
            </tr>
          </thead>
          <tbody>
            {hoteles.map((hotel) => (
              <tr key={hotel.id}>
                <th scope="row">{hotel.id}</th>
                <td>{hotel.NombreHotel}</td>
                <td>{hotel.Direccion}</td>
                <td>{hotel.Ciudad}</td>
                <td>{hotel.Nit}</td>
                <td>{hotel.NumeroHabitaciones}</td>
                <td>{hotel.idhabitacion}</td>
                <td>
                  <Link to={`/update/${hotel.id}`} className="btn btn-warning">
                    Editar
                  </Link>
                  <button
                    onClick={() => deleteHotel(hotel.id)}
                    className="btn btn-danger"
                  >
                    {" "}
                    Eliminar{" "}
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      <div class="card-footer clearfix">
        <ul class="pagination pagination-sm m-0 float-right">
          <li class="page-item">
            <a class="page-link" href="#">
              &laquo;
            </a>
          </li>
          <li class="page-item">
            <a class="page-link" href="#">
              1
            </a>
          </li>
          <li class="page-item">
            <a class="page-link" href="#">
              2
            </a>
          </li>
          <li class="page-item">
            <a class="page-link" href="#">
              3
            </a>
          </li>
          <li class="page-item">
            <a class="page-link" href="#">
              &raquo;
            </a>
          </li>
        </ul>
      </div>
    </div>
  );
};

export default ShowHotel;
